    false,nt"url": null,nt"notes": "This narrative report for Okefenokee National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1951. The report begins by summarizing the weather conditions, water conditions,
    food and cover, and wildfires during this period. Wildlife -including migratory
    birds, upland game birds, big animals, furbearers, predators, rodents, raptors,
    fish, and reptiles-  is also covered. The Refuge development and maintenance section
    discusses physical developments. The public relations section of the report describes
    recreational uses, Refuge visitors, Refuge participation, hunting, fishing, and
    violations. N-R forms and photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
